    value: '2nd AMENDMENT DESCRIPTION: This report is being amended to further clarify
      an item on Schedule D. The debt for Rosen Shingle Creek Golf Club as of 12/1/07
      has been corrected to $741,634.50. A payment of $362,219.14 was made on 12/4/07
      against this balance and is reflected on Sch. H4, pages 189 and 190 as a payment
      to American Express with the itemized memo showing the payment to Rosen Shingle
      Creek Golf Club. Our software program is unable to link the payment and therefore
      show a Payment This Period on Schedule D for this debit item since it was paid
      by American Express so we have shown the payment as a negative Amount Incurred
      This Period of $362,219.14. The outstanding balance at close of this period
      is $379,415.36. Report is also amended to include Schedule H2 that discloses
      the fundraising allocation ratio.    1st AMENDMENT DESCRIPTION:   1. This report
      is being amended to correct the Calendar Year-To-Date figures in Column B for
      lines 6c, 6d, 7, 11(a)(i), 11(a)(ii), 11(a)(iii), 11(d), 19, 20, 21(a)(i), 21(a)(ii),
      21(b), 21(c), 30(b), 30(c), 31, 32, 33, 35, 36 and 38 due to amendments filed
      after the original January Monthly Report (12/1/07-12/31/07) was filed.     No
      expenditure was made on behalf of a specifically identified federal candidate.
      No expenditure was for a public communication that referred to a clearly identified
      candidate for Federal office and that promoted, supported, attacked or opposed
      any such candidate for Federal office. All disbursements for salaries and benefits
      disclosed on Schedule H4 are for employees who did not spend more than 25% of
      their compensated time during the reporting period on Federal election activities
      or activities in connection with a Federal election. The Committee uses the
      Escrow option for receipt of corporate in-kind donations as provided for by
      the Commission in Advisory Opinion 1992-33. The method ensures that prohibited
      sources are not used to fund the federal share of allocable activity expenses.     Administrative
      Escrow account and In-kinds  12/01/07 balance is $26,442.41  12/06/07 Crystal
      Beach Development in-kind of $1,360 as reflected on Sch H4 and transfer on Sch
      H3 using $380.80 of escrow balance.  12/09/07 Arenas USA Inc in-kind of $5,000
      as reflected on Sch H4 and transfer on Sch H3 using $1,400 of escrow balance.  12/30107
      balance in Administrative escrow account of $24,661.61.  MD-08 Escrow account
      and In-kinds  12/01/07 balance is $78,496.80  12/06/07 Premier A1 Holdings in-kind
      of $6,000 as reflected on Sch H4 and transfer on Sch H3 using $480 of escrow
      balance.  12/09/07 ICI Aviation Leasing in-kind of $1,083 as reflected on Sch
      H4 and transfer on Sch H3 using $86.64 of escrow balance.  12/10/07 Panza, Maurer,
      & Maynard in-kind of $2,560 as reflected on Sch H4 and transfer on Sch H3 using
      $204.80 of escrow balance.  12/14/07 ICI Aviation Leasing in-kind of $10,000
      as reflected on Sch H4 and transfer on Sch H5 using $800 of escrow balance  12/31/07
      balance in MD-08 escrow account of $76,925.36.  On the original report covering
      11/1/07 - 11/30/07, Schedule D reflected an outstanding balance of $34,215.58
      for Yuma Solutions. That amount inadvertently included $2,891.67 that was a
      non-federal expenditure and was paid subsequently paid out of the non-federal
      account. This report reflects the corrected outstanding debt at the beginning
      of the period as $31,323.91 for Yuma Solutions and this amount was paid in full
      during this reporting period. The December monthly report (11/1/07 - 11/30/07)
      has also been amended and now reflects this correct balance.  '
